let seed = 123; // Sebuah seed awal
function Randoms(min, max) {
    // Parameter untuk LCG disesuaikan dengan uint8
    const a = 17;
    const c = 5;
    const m = 256; // 2^8

    // Menghasilkan angka pseudo-random baru
    seed = (a * seed + c) % m;
    flow.set("SEED",seed);
    const randomValue = min + (seed % (max - min + 1));
    return [randomValue,seed];
}

